import React from 'react';

import './App.css';

import BlogList from './components/BlogList';
import PostForm from './components/PostForm';

function App() {
  return (
    <div className="App">
      <h1>My Personal Blog</h1>
      <PostForm />
      <BlogList />
    </div>
  );
}

export default App;
